import React from "react";
import { FooterLinks, Icons } from "./Constants";
import {
  Container,
  FooterBlock,
  FooterContent,
  FooterListWrapper,
  NameLi,
  Li,
  FooterLink,
  FooterDivider,
  FooterIcon
} from "./FooterFragments";

const Footer = () => (
  <Container>
    <FooterBlock>
      <FooterContent>
        {FooterLinks.map(
          (item, index) =>
            !item.lowerFooter && (
              <FooterListWrapper key={index}>
                <ul className="text-left align-top">
                  <NameLi> {item.name} </NameLi>
                  {item.links.map((link, index) => (
                    <Li key={index}>
                      <FooterLink href={link.href}>{link.name}</FooterLink>
                    </Li>
                  ))}
                </ul>
              </FooterListWrapper>
            )
        )}
        {Icons.map(
          (item, index) =>
            !item.lowerFooter && (
              <FooterListWrapper key={index}>
                <ul className="text-left align-top">
                  <NameLi>{item.name}</NameLi>
                  {item.links.map((link, index) => (
                    <Li icon={true} key={index}>
                      <FooterIcon href={link.href} url={link.url} />
                    </Li>
                  ))}
                </ul>
              </FooterListWrapper>
            )
        )}
      </FooterContent>
    </FooterBlock>
    <FooterDivider />
    <FooterBlock>
      <FooterContent>
        {FooterLinks.map(
          (item, index) =>
            item.lowerFooter && (
              <FooterListWrapper key={index}>
                <ul className="text-left align-top">
                  <NameLi> {item.name} </NameLi>
                  {item.links.map((link, index) => (
                    <Li key={index}>
                      <FooterLink inactive={link.inactive} href={link.href}>
                        {link.name}
                      </FooterLink>
                    </Li>
                  ))}
                </ul>
              </FooterListWrapper>
            )
        )}
        {Icons.map(
          (item, index) =>
            item.lowerFooter && (
              <FooterListWrapper key={index}>
                <FootList>
                  <NameLi>{item.name}</NameLi>
                  {item.links.map((link, index) => (
                    <Li icon={true} key={index}>
                      <FooterIcon
                        country={item.country}
                        inactive={link.inactive}
                        href={link.href}
                        url={link.url}
                      />
                    </Li>
                  ))}
                </FootList>
              </FooterListWrapper>
            )
        )}
      </FooterContent>
    </FooterBlock>
  </Container>
);

export default Footer;
